import { Routes,BrowserRouter as Router,Route,Link} from 'react-router-dom';
import './App.css';
import Chartdemo from './chartdemo';
import Chartdemo2 from './chartdemo2';
import Chartdemo3 from './chartdemo3';
import Listdemo from "./listdemo";
import {Component} from "react";


class App extends Component{
  render(){

    return(


    <Router >
     <div className="App">

        <Routes>

       <Route path="/home" element={<Listdemo/>}>
         <Route path='history' element={<Chartdemo/>}></Route>
         <Route path='region' element={<Chartdemo2/>}></Route>
         <Route path='3d' element={<Chartdemo3/>}></Route>
       </Route>
        </Routes>
         </div>
    </Router>
    //  <Listdemo/>


    )
  }

}


export default App;
